import React from 'react';
import ContactDemo from './ContactDemo';

function App() {
  return (
    <div className="max-w-xl mx-auto p-4">
      {/* عنوان الصفحة */}
      <h1 className="text-center text-2xl font-bold mb-4">Contact Demo</h1>

      {/* نص ترحيبي */}
      <p className="text-center mb-6">مرحبا بك فالمشروع ديال Contact!</p>

      {/* الفورم */}
      <ContactDemo />
    </div>
  );
}

export default App;
